import React, { useContext, useState, useEffect } from 'react';
import { CoinsPriceContext, CoinsPriceProvider } from './PriceCoins.js';
import { PriceChangeContext, PriceChangeProvider } from './PriceChange.js';
import './App.css'
import btc from './images/btc.png'
import eth from './images/eth.png'
import bnb from './images/bnb.png'
import ada from './images/ada.png'
import xrp from './images/xrp.png'

const images = [
  btc,
  eth,
  bnb,
  ada,
  xrp,
];

function App() {
  const [currentImage, setCurrentImage] = useState(0);
  const CoinsPriceProvider = useContext(CoinsPriceContext);
  const PriceChangeProvider = useContext(PriceChangeContext);


  useEffect(() => {
    setInterval(() => {
      setCurrentImage((currentImage + 1) % images.length);
    }, 10000);
  }, [currentImage]);

  const getPriceChangeColor = priceChange => {
    if (priceChange >= 0) {
      return { color: 'green' };
    } else {
      return { color: 'red' };
    }
  };

  return (
    <section>
      <div className='container'>
        <h1>Crypto Tracker</h1>
      </div>
      <div className='agrupado'>
        <div className='containerleft'>
          <div className='containerrow'>
            <h1 className="right-aligned">Name</h1>
            <h1 className="right-aligned">Price</h1>
            <h1>24h%</h1>
          </div>
          <div className='containerrow'>
            <h1>BTC</h1>
            <h1>$ {CoinsPriceProvider.btcPrice}</h1>
            <h1 style={{ color: PriceChangeProvider.btcPriceChange > 0 ? 'green' : 'red' }}>
              {PriceChangeProvider.btcPriceChange > 0 ? '+' : ''}{(PriceChangeProvider.btcPriceChange * 1).toFixed(2)}%
            </h1>
          </div>
          <div className='containerrow'>
            <h1>ETH</h1>
            <h1>$ {CoinsPriceProvider.ethPrice}</h1>
            <h1 style={{ color: PriceChangeProvider.ethPriceChange > 0 ? 'green' : 'red' }}>
              {PriceChangeProvider.ethPriceChange > 0 ? '+' : ''}{(PriceChangeProvider.ethPriceChange * 1).toFixed(2)}%
            </h1>
          </div>
          <div className='containerrow'>
            <h1>BNB</h1>
            <h1>$ {CoinsPriceProvider.bnbPrice}</h1>
            <h1 style={{ color: PriceChangeProvider.bnbPriceChange > 0 ? 'green' : 'red' }}>
              {PriceChangeProvider.bnbPriceChange > 0 ? '+' : ''}{(PriceChangeProvider.bnbPriceChange * 1).toFixed(2)}%
            </h1>
          </div>
          <div className='containerrow'>
            <h1>ADA</h1>
            <h1>$ {CoinsPriceProvider.adaPrice}</h1>
            <h1 style={{ color: PriceChangeProvider.adaPriceChange > 0 ? 'green' : 'red' }}>
              {PriceChangeProvider.adaPriceChange > 0 ? '+' : ''}{(PriceChangeProvider.adaPriceChange * 1).toFixed(2)}%
            </h1>
          </div>
          <div className='containerrow'>
            <h1>XRP</h1>
            <h1>$ {CoinsPriceProvider.xrpPrice}</h1>
            <h1 style={{ color: PriceChangeProvider.xrpPriceChange > 0 ? 'green' : 'red' }}>
              {PriceChangeProvider.xrpPriceChange > 0 ? '+' : ''}{(PriceChangeProvider.xrpPriceChange * 1).toFixed(2)}%
            </h1>
          </div>
          <div className='containerrow'>
            <h1>LTC</h1>
            <h1>$ {CoinsPriceProvider.ltcPrice}</h1>
            <h1 style={{ color: PriceChangeProvider.ltcPriceChange > 0 ? 'green' : 'red' }}>
              {PriceChangeProvider.ltcPriceChange > 0 ? '+' : ''}{(PriceChangeProvider.ltcPriceChange * 1).toFixed(2)}%
            </h1>
          </div>
        </div>
        <div className='containerright'>
          <h1>OI</h1>
        </div>
      </div>
    </section>
  );
}

export default () => (
  <CoinsPriceProvider>
    <PriceChangeProvider>
      <App />
    </PriceChangeProvider>
  </CoinsPriceProvider>
);

